        // get value from slider and buffer the input drawnItem/layerData, add it to map, removes the previous one, calls for calculating all intersects data within buffer. 
        function turfHandler(layerData, highlightLayer, select1Id, select2Id, select3Id, sliderId){
            var bufferValue = document.getElementById(sliderId).value;
            previousbufferValue = bufferValue;
            var buffered = turf.buffer(layerData, bufferValue, {units: 'miles'});
            drawnItems.removeLayer(currentDrawnItem);
            try{
                drawnItems.removeLayer(previousDrawnItem);
            } catch (err){

            var layer = L.geoJSON(buffered);
            layer.addTo(drawnItems);
            previousDrawnItem = layer;
            intersectedItems(geodata, layer, highlightLayer, select1Id, select2Id, select3Id);
        }
        // take in user's buffer and geoJSON data, to calculate the overlap data and return an array of each intersect/overlap geo features
        // in the format of [ratio, geo feature data, overlap area/length/count, feature area/length/count, overlap feature data]
        function intersectedItems(geodata, layerData, highlightLayer, select1Id, select2Id, select3Id){
            var features1 = geodata.features;
            var intersectItems = [];
            var geometryType;
            if (features1[0].geometry.type == "Polygon" || features1[0].geometry.type == "MultiPolygon"){
                for (var i = 0; i < features1.length; i++){
                    var layerData1 = layerData.toGeoJSON().features["0"];
                    var overRide = turf.intersect(features1[i]["geometry"], layerData1);
                    if (overRide != null){
                        var overRideArea = turf.area(overRide);
                        var intersectItem = features1[i];
                        var intersectItemArea = turf.area(features1[i]["geometry"]);
                        var intersectedRatio = (overRideArea / intersectItemArea);
                        var arrData = [intersectedRatio, intersectItem, overRideArea, intersectItemArea, overRide];
                        intersectItems.push(arrData);
                    }
                }
                geometryType = "Polygon";
            } else if (features1[0].geometry.type == "LineString" || features1[0].geometry.type == "MultiLineString"){
                var layerData1 = layerData.toGeoJSON().features["0"];
                for (var i = 0; i < features1.length; i++){
                    var intersectionPoints = turf.lineIntersect(features1[i]["geometry"], layerData1);
                    if (intersectionPoints.features.length != 0){
                        //console.log(intersectionPoints);
                        var bufferedLine = turf.buffer(features1[i]["geometry"], 0.01, {units: "kilometers"});
                        var overRide = turf.intersect(bufferedLine, layerData1);
                        if (overRide != null){
                            var overRideArea = turf.area(overRide);
                            var intersectItem = features1[i];
                            var intersectItemArea = turf.area(bufferedLine);
                            var intersectedRatio = (overRideArea / intersectItemArea);
                            var intersectItemLength = turf.length(features1[i]["geometry"], {units: 'miles'});
                            var overRideLength = intersectItemLength * intersectedRatio;
                            var arrData = [intersectedRatio, intersectItem, overRideLength,intersectItemLength, overRide];
                            intersectItems.push(arrData);
                        }
                    } else {
                        if (turf.booleanContains(layerData1, features1[i]["geometry"])){
                            //var bufferedLine = turf.buffer(features1[i]["geometry"], 0.01, {units: "kilometers"});
                            //var overRide = turf.intersect(bufferedLine, layerData1);
                            var overRideLength = turf.length(features1[i]["geometry"], {units: 'miles'});
                            var intersectItem = features1[i];
                            var intersectItemLength = overRideLength;
                            var arrData = [1.0, intersectItem, overRideLength, intersectItemLength, intersectItem];
                            intersectItems.push(arrData);
                        }
                    }
                }
                geometryType = "LineString";
            } else if (features1[0].geometry.type == "Point" || features1[0].geometry.type == "MultiPoint"){
                for (var i = 0; i < features1.length; i++){
                    var layerData1 = layerData.toGeoJSON().feautres["0"];
                    var pointInPolygon = turf.booleanPointInPolygon(features1[i]["geometry"], layerData1);
                    if (pointInPolygon){
                        var intersectItem = features1[i];
                        var arrData = [1.0, intersectItem, 1.0, 1.0, intersectItem];
                        intersectItems.push(arrData);
                    }
                }
                geometryType = "Point";
            }
            //console.log(geodata.features[0].geometry.type);
            //console.log(intersectItems);
            //intersectHighlight(intersectItems);

            //overlayPolylineHighlight(intersectItems, highlightLayer);
            overlayHighlight(intersectItems, highlightLayer, geometryType);
            var firstSelect = document.getElementById(select1Id);
            var secondSelect = document.getElementById(select2Id);
            var thirdSelect = document.getElementById(select3Id);
            var firstSelectValue = firstSelect.options[firstSelect.selectedIndex].value;
            var secondSelectValue = secondSelect.options[secondSelect.selectedIndex].value;
            var thirdSelectValue = thirdSelect.options[thirdSelect.selectedIndex].value;
            dataOutput(intersectItems,firstSelectValue, secondSelectValue, thirdSelectValue, "panelBody", "chartContainer");
        }
        // can be use if ratio is not considered
        function simpleIntersectedItems(geodata, layerData){
            var features1 = geodata.features;
            var intersectItems = [];
            var layerData1 = layerData.toGeoJSON().features["0"];
            for (var i = 0; i < features1.length; i++){
                var intersectBoolean = turf.booleanIntersects(features1[i]["geometry"], layerData1);
                if (intersectBoolean){
                    intersectItems.push(features1[i]);
                }
            }
            return intersectItems;
        }

        // highlight all intersected features
        function intersectHighlight(intersectArr, highlightLayer, geometryType){
            if (geometryType == "Polygon"){
                var thisArr = [];
                for (var i = 0; i < intersectArr.length; i++){
                    if(intersectArr[i].length >= 5){
                        thisArr.push(intersectArr[i][1]);
                    } else {
                        thisArr.push(intersectArr[i][0]);
                    }
                }
                var dataJSON = {"type":"FeatureCollection", "features": thisArr};
                var newLayer = L.geoJSON(dataJSON,{
                    style: function(feature){
                        return {fillColor: "blue",
                        fillOpacity: 0.8,
                        weight: 0.5};
                    }
                });
                highlightLayer.clearLayers();
                highlightLayer.addLayer(newLayer);
                highlightLayer.addTo(map);
            } else if (geometryType == "LineString"){
                var thisArr = [];
                for (var i = 0; i < intersectArr.length; i++){
                    if (intersectArr[i].length >= 5){
                        thisArr.push(intersectArr[i][4]);
                    } else{
                        thisArr.push(intersectArr[i][0]);
                    }
                }
                var dataJSON = {"type":"FeatureCollection", "features": thisArr};
                var newLayer = L.geoJSON(dataJSON,{
                    style: function(feature){
                        return {color: "blue",
                            fillColor: "blue",
                        fillOpacity: 1,
                        weight: 5};
                    }
                });
                highlightLayer.clearLayers();
                highlightLayer.addLayer(newLayer);
                highlightLayer.addTo(map);
            }
        }

        // create an array of different color with size of input size
        function generateRandomColorArray(size){
            var letters = '0123456789ABCDEF';
            var colorArr = new Array();
            while (colorArr.length < size){
                var color = '#';
                for (var i = 0; i < 6; i++){
                    color += letters[Math.floor(Math.random() * 16)];
                }
                if (!colorArr.includes(color)){
                    colorArr.push(color)
                }
            }
            return colorArr;
        }

        function dataOutput(arr, firstSelectValue, secondSelectValue, thirdSelectValue, labelId, chartContainer){
            if(arr == null || arr.length == 0 || firstSelectValue == "default" || secondSelectValue == "default"){

            } else {
                var attributeName = firstSelectValue;
                if(mainChart != undefined){
                        mainChart.destroy();
                }

                    pieChart.destroy();
                }
                if (secondSelectValue == "aggregation"){
                    var resultVar = 0;
                    for (var i = 0; i < arr.length; i++){

                        resultVar += polygonValue;
                    }
                    if (!isNaN(resultVar)){
                        resultVar = resultVar.toFixed(2);
                        var display = document.getElementById(labelId);
                        display.innerHTML = attributeName + " (Aggregation with buffer of " + previousbufferValue + "): " + "<strong>" + resultVar.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ',') + "</strong>";
                    }
                } else if (secondSelectValue == "average"){
                    var sumVar = 0;
                    var divideVar = 0;
                    for (var i = 0; i < arr.length; i++){
                        sumVar += parseFloat(arr[i][2]) * arr[i][1]["properties"][attributeName];
                        divideVar += parseFloat(arr[i][2]);
                    }
                    var resultVar = sumVar / divideVar;
                    if (!isNaN(resultVar)){
                        resultVar = resultVar.toFixed(2);
                        var display = document.getElementById(labelId);
                        display.innerHTML = attributeName + " (Average with buffer of " + previousbufferValue + "): " + "<strong>" + resultVar.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ',') + "</strong>";
                    }
                } else if (secondSelectValue == "weighted average" && thirdSelectValue != "default"){
                    var sumVar = 0;
                    var divideVar = 0;
                    for (var i = 0; i < arr.length; i++){
                        var weighted = parseFloat(arr[i][0]) * arr[i][1]["properties"][thirdSelectValue];
                        sumVar += arr[i][1]["properties"][attributeName] * weighted
                        divideVar += weighted;
                    }
                    var resultVar = sumVar / divideVar;
                    if (!isNaN(resultVar)){
                        resultVar = resultVar.toFixed(2);
                        var display = document.getElementById(labelId);
                        display.innerHTML = attributeName + " per " + thirdSelectValue + " with buffer of " + previousbufferValue + ": " + "<strong>" + resultVar.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ',') + "</strong>";
                    }
                } else if (secondSelectValue == "categorical"){
                    arr = arr.sort(function(a, b){a[1]["properties"][attributeName] - b[1]["properties"][attributeName]});
                    var xArr = [];
                    var yArr = [];
                    for (var i = 0; i < arr.length; i++){
                        if (!xArr.includes(arr[i][1]["properties"][attributeName])){
                            xArr.push(arr[i][1]["properties"][attributeName]);
                            yArr.push(parseFloat(arr[i][2]))
                        } else {
                            var index = xArr.indexOf(arr[i][1]["properties"][attributeName]);
                            yArr[index] += parseFloat(arr[i][2]);
                        }
                    }
                    if (xArr.length < 20){
                        var sum = 0;
                        for (var i = 0; i < yArr.length; i++){
                            sum += yArr[i];
                        }
                        for (var i = 0; i < yArr.length; i++){
                            yArr[i] = (yArr[i] / sum);
                        }
                        var display = document.getElementById(labelId);
                        var stringData = "";

                            stringData += "" + xArr[i] + " (" + attributeName + "): " + (yArr[i] * 100).toFixed(2) + "%, ";
                        }
                        display.innerText = stringData.substring(0, stringData.length - 2);
                        var container = document.getElementById(chartContainer);
                        var chart1 = document.createElement("canvas");
                        chart1.id = "chart";

                        var chart2 = document.createElement("canvas");
                        chart2.id = "pie";
                        chart2.style = "width:100%;height:100%;";
                        container.appendChild(chart1);
                        container.appendChild(chart2);
                        mainChart = new Chart("chart",{
                            type: "bar",
                            data: {
                                labels: xArr,
                                datasets:[{

                                    data: yArr

                                    display: true,
                                    text: attributeName + " Category"
                                },
                                responsive: false,
                                responsiveAnimationDuration: 0,
                                animation: false
                            }
                        });
                        mainChart.update();
                        pieChart = new Chart("pie",{
                            type: "pie",
                            data:{

                                datasets:[{

                                    data: yArr
                                }]
                            },

                                    color: "#ffffff",
                                    display: true,
                                    text: attributeName + " Category"
                                },
                                responsive: false,
                                responsiveAnimationDuration: 0,
                                animation: false
                            }
                        });

                        display.innerHTML = attributeName + " (Aggregation): <strong>" + resultVar.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ',') + "</strong>";
                    }
                } else if (secondSelectValue == "average"){
                    var sumVar = 0;
                    var divideVar = 0;
                    for (var i = 0; i < arr.length; i++){
                        if (arr[i].length == 1){
                            sumVar += parseFloat(arr[i][0]["properties"][attributeName]);
                            divideVar += 1;
                        }
                    }
                    var resultVar = sumVar / divideVar;
                    if (!isNaN(resultVar)){
                        resultVar = resultVar.toFixed(2);
                        var display = document.getElementById(labelId);
                        display.innerHTML = attributeName + " (Average): <strong>" + resultVar.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ',') + "</strong>";
                    }
                } else if (secondSelectValue == "weighted average"){
                    var sumVar = 0;
                    var divideVar = 0;
                    for (var i = 0; i < arr.length; i++){
                        if (arr[i].length == 1){
                            var weighted = parseFloat(arr[i][0]["properties"][thirdSelectValue]);
                            sumVar += arr[i][0]["properties"][attributeName] * weighted;
                            divideVar += weighted;
                        }
                    }
                    var resultVar = sumVar / divideVar;
                    if (!isNaN(resultVar)){
                        resultVar = resultVar.toFixed(2);
                        var display = document.getElementById(labelId);
                        display.innerHTML = attributeName + " with weight " + thirdSelectValue + " (weighted average): <strong>" + resultVar.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ',') + "</strong>";
                    }
                } else if (secondSelectValue == "categorical"){
                    arr = arr.sort(function(a, b){a.features["properties"][attributeName] - b.features["properties"][attributeName]});
                    var xArr = [];
                    var yArr = [];
                    for (var i = 0; i < arr.length; i++){
                        if (arr[i].length == 1){
                            if (!xArr.includes(arr[i][0]["properties"][attributeName])){
                                xArr.push(arr[i][0]["properties"][attributeName]);
                                yArr.push(1);
                            } else{
                                var index = xArr.indexOf(arr[i][0]["properties"][attributeName]);
                                yArr[index] += 1;
                            }
                        }
                    }
                    if (xArr.length < 20){
                        var sum = 0;
                        for (var i = 0; i < yArr.length; i++){
                            sum += yArr[i];
                        }
                        for (var i = 0; i < yArr.length; i++){
                            yArr[i] = (yArr[i] / sum);
                        }
                        
                        var list = [];
                        for (var i = 0; i < xArr.length; i++){
                            list.push({"value":xArr[i], "percentage":yArr[i]});
                        }
                        list.sort(function(a, b){
                            return ((a.value < b.value) ? -1 : ((a.value == b.value) ? 0 : 1));
                        });

                        for (var i = 0; i < list.length; i++){
                            xArr[i] = list[i].value;
                            yArr[i] = list[i].percentage;
                        }

                        var display = document.getElementById(labelId);
                        var stringData = "";
                        for (var i = 0; i < xArr.length; i++){
                            stringData += "" + xArr[i] + " (" + attributeName + "): <strong>" + (yArr[i] * 100).toFixed(2) + "%</strong>, ";
                        }
                        stringData = stringData.substring(0, stringData.length - 2);
                        display.innerHTML = stringData;
                        
                        var container = document.getElementById(chartContainer);
                        container.innerHTML = "";
                        var chart1 = document.createElement("canvas");
                        chart1.id = "chart";
                        chart1.style = "width:100%;height:100%;float: left;";
                        var chart2 = document.createElement("canvas");
                        chart2.id = "pie";
                        chart2.style = "width:100%;height:100%;";
                        container.appendChild(chart1);
                        container.appendChild(chart2);
                        mainChart = new Chart("chart",{
                            type: "bar",
                            data:{
                                labels: xArr,
                                datasets:[{
                                    backgroundColor: colors,
                                    data: yArr
                                }]
                            },
                            options: {
                                legend:{display:false},
                                title:{
                                    color: "#ffffff",
                                    display: true,
                                    text: attributeName + " Category"
                                },
                                responsive: false,
                                responsiveAnimationDuration: 0,
                                animation: false
                            }
                        });
                        mainChart.update();
                        pieChart = new Chart("pie",{
                            type: "pie",
                            data:{
                                labels: xArr,
                                datasets:[{
                                    backgroundColor: colors,
                                    data:yArr
                                }]
                            },
                            options:{
                                legend:{display: false},
                                title:{
                                    color:"#ffffff",
                                    display: true,
                                    text: attributeName + " Category"
                                },
                                responsive: false,
                                responsiveAnimationDuration: 0,
                                animation: false
                            }
                        });
                        pieChart.update();
                    }
                }
            }
        }

        // not used, but usefully function to determine value type for each attribute
        function updateTypeLookupTable(data1){
            var attributeTypeLookupTable = {};
            features1 = data1.features;
            var attributeNames = Object.keys(features1[0].properties);
            var attributeValues = Object.values(features1[0].properties);
            for (var i = 0; i < attributeValues.length; i++){
                if (isNaN(attributeValues[i])){
                    attributeTypeLookupTable[attributeNames[i]] = "string";
                } else{
                    if (attributeValues[i].toString().indexOf('.') == -1){
                        attributeTypeLookupTable[attributeNames[i]] = "int";
                    } else {
                        attributeTypeLookupTable[attributeNames[i]] = "float";
                    }
                }
            }
            for (var i = 0; i < features1.length; i++){
                attributeValues = Object.values(features1[i].properties);
                for (var j = 0; j < attributeValues.length; j++){
                    if (attributeTypeLookupTable[attributeNames[j]] == "string"){
                    } else {
                        if (attributeTypeLookupTable[attributeNames[j]] == "int" && attributeValues[j].toString().indexOf('.') != -1){
                            attributeTypeLookupTable[attributeNames[j]] = "float";
                        }
                    }
                }
            }
            return attributeTypeLookupTable;
        }
